import React from 'react';
import { Link } from 'react-router-dom';
export {Login} from './components/Login'

const Login = () => {
  return (
    <div>
      In the login
      <Link to="/signup" className="btn btn-primary">SignUp</Link>
    </div>
  );
};

export default Login;
